import React from 'react';
import UusiTilaus from './components/UusiTilaus';

import { makeStyles } from '@material-ui/core/styles';
import {blue, deepPurple, cyan } from '@material-ui/core/colors/';

import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';

import { BrowserRouter, Route, Switch } from 'react-router-dom';


const tyyli = makeStyles ({
  otsikko: {
    height: 70,
    backgroundColor: blue[50]
  }
})

function App() {
  const classes = tyyli();

  return (
    <Grid>
      <Paper className= {classes.otsikko}>
        <Typography variant='h4' component='h1' align='center'>Labra</Typography>
      </Paper>
      <Switch>
          <Route exact path='/' component= {UusiTilaus}/>
          <Route component={UusiTilaus}/>
        </Switch>
    </Grid>
  );
}

export default App;
